configure:
  commands:
    end:
      new_state: execute
    interface vlan 11: "\r\n"
    line console 0:
      new_state: configure_line
    no logging console: ''
    standby 11 priority 200: "*Feb 17 06:26:46.158: %SYS-5-CONFIG_I: Configured from\
      \ console by consoleinterface vlan 11\r\n"
  prompt: 9500-Core(config)#
configure_line:
  commands:
    end:
      new_state: execute
    exec-timeout 0: ''
  prompt: 9500-Core(config-line)#
connect:
  commands:
    ? ''
    : new_state: execute
  preface: 'Trying mock_device ...

    Connected to mock_device.

    Escape character is ''^]''.'
  prompt: ''
execute:
  commands:
    config term:
      new_state: configure
    config-transaction:
      new_state: configure
    show version: ''
    term length 0: ''
    term width 0: ''
  prompt: 9500-Core#
